from collections import defaultdict

n = int(input())  # number of students
students = [input() for _ in range(n)]

grades = defaultdict(int)
for student in students:
    grades[student] += 1

max_count = max(grades.values())
best_students = [student for student, count in grades.items() if count == max_count]
best_students.sort()

for student in best_students:
    print(student)


import sys

def main():
    lines = []
    for line in sys.stdin:
        lines.append(line.rstrip('\n'))
    num_colleagues = int(lines[0])
    clothes = []
    for i in range(1, num_colleagues + 1):
        clothes.append(lines[i])
    clothes_dict = {}
    for clothes in clothes:
        if clothes not in clothes_dict:
            clothes_dict[clothes] = 1
        else:
            clothes_dict[clothes] += 1
    highest = 0
    for clothes in clothes_dict:
        if clothes_dict[clothes] > highest:
            highest = clothes_dict[clothes]
    best_clothes = []
    for clothes in clothes_dict:
        if clothes_dict[clothes] == highest:
            best_clothes.append(clothes)
    best_clothes.sort()
    for clothes in best_clothes:
        print(clothes)

if __name__ == "__main__":
    main()
